import React from 'react';

function Reviews(){
    var stylingObject = {
        container: {
            background: "#F6836B",
            height: "1000px"
        }
    }
    return(
        <div>
            <div style={stylingObject.container}></div> 
        </div>

    )
}

export default Reviews;
